/* harmony default export */ var v_button_README = ("## v-button\r\n\r\n### Code\r\n\r\n```\r\n  <h1 aria-level=\"2\">v-button</h1>\r\n  \r\n    <h2>Standard</h2>\r\n    <v-button primary>Primary Button</v-button>\r\n    <v-button secondary>Secondary Button</v-button>\r\n\r\n    <h2>Disabled</h2>\r\n    <v-button primary disabled>Primary Button - Disabled</v-button>\r\n    <v-button secondary disabled>Secondary Button - Disabled</v-button>\r\n\r\n    <h2>Disabled and Spinner</h2>\r\n    <v-button primary disabled busy>Primary Button - Disabled</v-button>\r\n    <v-button secondary disabled busy>Secondary Button - Disabled</v-button>\r\n\r\n    <h2>Links</h2>\r\n    <v-button href=\"https://www.voya.com\" primary>Link to Voya</v-button>\r\n    <v-button href=\"https://my.voya.com/\" secondary>Link to MyVoya</v-button>\r\n\r\n    <h2>Button with External Icon href is not given</h2>\r\n    <v-button primary\r\n      >External Link\r\n      <v-icon\r\n        name=\"externalLink\"\r\n        color=\"--v-colors__white\"\r\n        size=\"18px\"\r\n        style=\"margin-left:8px;\"\r\n      ></v-icon\r\n    ></v-button>\r\n  \r\n    <h2>\r\n      Button without External Icon if href is '#' and taget is '_blank'\r\n    </h2>\r\n    <v-button primary target=\"_blank\" href=\"#\"\r\n      >Without External Icon Link\r\n    </v-button>\r\n\r\n    <h2>\r\n      Button without External Icon if href is '#' and taget is '_blank'\r\n    </h2>\r\n    <v-button secondary target=\"_blank\" href=\"www.google.com\"\r\n      >With External Icon Link with scondary\r\n    </v-button>\r\n\r\n    <h2>\r\n      Button with External Icon Target as \"_blank\" and href is external URL\r\n    </h2>\r\n    <v-button primary target=\"_blank\" href=\"https://www.google.com\"\r\n      >External Link\r\n    </v-button>\r\n\r\n    <h2>Button with External Icon Target as \"\" and href is external URL</h2>\r\n    <v-button primary href=\"https://www.google.com\">External Link </v-button>\r\n\r\n    <h2>Button with External Icon Target as \"\" and href is github Pages URL</h2>\r\n    <v-button primary href=\"https://pages.github.voya.net/Voya/VDS\"\r\n      >External Link\r\n    </v-button>\r\n\t\r\n\t<h2>\r\n      Button without External Icon if href is '/foo/bar' (internal action) and taget is ''\r\n    </h2>\r\n    <v-button primary href=\"/foo/bar\"\r\n      >Without External Icon Link\r\n    </v-button>\r\n\r\n    <h2>Form Submit</h2>\r\n    <form method=\"GET\" id=\"test\" name=\"test\">\r\n      <v-input-field\r\n        labeltext=\"Field 1\"\r\n        name=\"field1\"\r\n        type=\"text\"\r\n      ></v-input-field>\r\n      <v-button primary type=\"submit\">Submit</v-button>\r\n    </form>\r\n\r\n    <h2>Links with aria label</h2>\r\n    <v-button href=\"https://www.voya.com\" primary arialabel=\"Link to Voya\">Link to Voya</v-button>\r\n    <v-button href=\"https://my.voya.com/\" secondary arialabel=\"Link to MyVoya\">Link to MyVoya</v-button>\r\n    <v-button href=\"https://www.google.com/\" secondary arialabel=\"Link to Google\">Link to Google</v-button>\r\n```\r\n\r\n### Usage\r\n\r\n- if `href` is provided, the button will be an `<a>` tag rather than a `<button>`\r\n- if `href` is provided and its an internal link (internal action or redirection), the button will be a normal (not external).  \r\n   internal action or redirection href will not have \"http\" or \"https\".\r\n- if `href` and `target` is provided and `target` is \"\\_blank\", the button will be a external button and opens up a new tab on click.\r\n- if `href` and `target` is provided (not empty) and `target` is othen than \"\\_blank\", then `href` is checked for wildcard host (ends with voya.com, voya.net) if it is an external URL, then the button will be a external button and opens up a new tab on click.\r\n- if `href` and `target` is provided (not empty) and `target` is othen than \"\\_blank\", then `href` is checked for wildcard host (ends with voya.com, voya.net) if it is not an external URL, then the button will not be a external button and opens up same tab on click.\r\n- Either primary or secondary must be provided.\r\n- spinner will only come on if busy true.\r\n- spinner's default color is white.\r\n- `type` should have either `button` or `submit`. if type is submit then no need to provide handler to submit, it will work like normal submit button. if tyoe is button then there is click event which can use to do work on click.\r\n- By including `External Icon` as above example, user can get External Icon Button (without giving href or target) and control on click event by implementing `@click` for button.\r\n- if `arialabel` not provided then if external link's aria label will be `open new window` and if its not external link then aria-label will be 'Link to `href`'.\r\n- if `arialabel` not provided then if button will use button text as area label.\r\n\r\n### Attributes\r\n\r\n| Attribute | Property  | Data Type | Default | Notes                                                            |\r\n| --------- | --------- | --------- | ------- | ---------------------------------------------------------------- |\r\n| disabled  | disabled  | Boolean   | false   | n/a                                                              |\r\n| href      | href      | String    | ''      | If provided, this will be an `<a>` tag rather than a `<button>`. |\r\n| primary   | primary   | Boolean   | false   | Either primary or secondary must be provided.                    |\r\n| secondary | secondary | Boolean   | false   | Either primary or secondary must be provided.                    |\r\n| busy      | busy      | Boolean   | false   | if true then only spinner will come                              |\r\n| type      | type      | String    | button  | should have either button or submit value.                       |\r\n| target    | target    | String    | \"\"      | if provided, this will be taret for href opening                 |\r\n| arialabel | arialabel | String    | \"\"      | if provided, this will be `aria-label` for links                 |\r\n\r\n### Slots\r\n\r\n| Name         | Expects   | Notes |\r\n| ------------ | --------- | ----- |\r\n| none/default | text node | n/a   |\r\n\r\n### Events\r\n\r\nCustom Events can include a `detail` object that provides relevant data. Access this data under `e.detail`.\r\n\r\n| Name            | Notes                                     | Detail Properties |\r\n| --------------- | ----------------------------------------- | ----------------- |\r\n| `vbutton-click` | whenever the internal v-button is clicked | none              |\r\n\r\n### Custom CSS Properties\r\n\r\n| Custom CSS Property      | CSS property | default | Notes            |\r\n| ------------------------ | ------------ | ------- | ---------------- |\r\n| --v-button-spinner-color | color        | White   | color of spinner |\r\n");
