/* harmony default export */ var v_cta_README = ("## v-cta\r\n\r\n### Code\r\n\r\n```\r\n<h1>v-cta</v-cta>\r\n<h2>Default CTA</h2>\r\n<v-cta\r\n\tctaImage=${piggyBank}\r\n\talt=\"Piggy bank\"\r\n\tctaHeaderText=\"Want Professional Advice?\"\r\n\tctaSubText=\"A financial professional will manage your personal investment strategy and work towards helping you achieve your retirement goals.\"\r\n\tdataLabel=\"primary button\"\r\n\tbuttonText =\"Get Professional Advice\"\r\n\tbuttonHref=\"/\"\r\n>\r\n</v-cta>\r\n\r\n\r\n<h2>Email Form CTA</h2>\r\n<v-cta\r\n\tctaImage=${emailIcon}\r\n\talt=\"Email\"\r\n\tctaHeaderText=\"Sign Up For Our Newsletter\"\r\n\tctaSubText=\"Get retirement tips delivered to your inbox along with invitations to upcoming educational workshops.\"\r\n\tdataLabel=\"primary button\"\r\n\tbuttonText =\"Sign Up\"\r\n\tbuttonHref=\"/\"\r\n\temail    \r\n>\r\n</v-cta>\r\n\r\n\r\n<h2>Email Form CTA with error and error</h2>\r\n\t<v-cta\r\n\t\tctaImage=\"./static/emailIcon.png\"\r\n\t\talt=\"Email\"\r\n\t\tctaHeaderText=\"Sign Up For Our Newsletter\"\r\n\t\tctaSubText=\"Get retirement tips delivered to your inbox along with invitations to upcoming educational workshops.\"\r\n\t\tdataLabel=\"primary button\"\r\n\t\tbuttonText =\"Sign Up\"\r\n\t\tbuttonHref=\"/\"\r\n\t\temail\t\t\r\n\t\terror \r\n\t\terrorText=\"Error Text\"\r\n\t\t@vCTA-submit=\"${e => e.detail}\"\r\n\t>\r\n\t</v-cta>\r\n\r\n```\r\n\r\n### Usage\r\n\r\n- This component is used to highlight information\r\n- Includes v-button component\r\n- By default button is primary style, can pass secondaryButton to get secondary style.\r\n- on click of button an ajax will go to provided in `buttonHref` and response will available for callback event `vCTA-submit`.\r\n\r\n### Attributes\r\n\r\n| Attribute            | Property        | Data Type | Default | Notes                                                                |\r\n| -------------------- | --------------- | --------- | ------- | -------------------------------------------------------------------- |\r\n| CTA Image            | ctaImage        | String    | \"\"      | Takes a URL to an image to use in the CTA                            |\r\n| CTA Header Text      | ctaHeaderText   | String    | \"\"      | Takes a string for the CTA Header Text                               |\r\n| CTA Sub Text         | ctaSubText      | String    | \"\"      | Takes a string for the CTA Sub Header Text                           |\r\n| Data Label           | Data Label      | String    | \"\"      | Label for button                                                     |\r\n| Button Href          | buttonHref      | String    | \"\"      | Takes a URL for v-button buttonHref                                  |\r\n| Button Text          | buttonText      | String    | \"\"      | Takes a string for v-button CTA text                                 |\r\n| Button Style         | secondaryButton | Boolean   | false   | Allows for button to be secondary style                              |\r\n| Email Form           | email           | Boolean   | false   | When true displays variation of CTA with email input                 |\r\n| email key            | requestEmailKey | String    | \"email\" | key name which needs to sent in json request when submit email       |\r\n| error         \t   | error           | Boolean   | false   | Applies error styling.                          \t\t\t\t      |\r\n| errortext            | errorText       | String    | \"\"      | Unless a non-empty string is provided, no error text will appear.    |\r\n\r\n### Events\r\n\r\nCustom Events can include a `detail` object that provides relevant data. Access this data under `e.detail`.\r\n\r\n| Name          | Notes                                     | Detail Properties |\r\n| ------------- | ----------------------------------------- | ----------------- |\r\n| `vCTA-submit` | whenever the internal v-button is clicked | none              |\r\n");
