/* harmony default export */ var v_dollar_percent_input_README = ("## v-dollar-percent-input\r\n\r\n### Code\r\n\r\n#### Dollar\r\n\r\n```\r\n<v-dollar-percent-input\r\n  decimalplaces=\"2\"\r\n  dollar\r\n  withcommas\r\n  value=\"100.00\"\r\n  altLabel=\"test\"\r\n></v-dollar-percent-input>\r\n<v-dollar-percent-input\r\n  dollar\r\n  withcommas\r\n  value=\"30000\"\r\n  altLabel=\"test\"\r\n></v-dollar-percent-input>\r\n```\r\n\r\n#### Percent\r\n\r\n```\r\n<v-dollar-percent-input\r\n  decimalplaces=\"1\"\r\n  percent\r\n  value=\"5.5\"\r\n  altLabel=\"test\"\r\n></v-dollar-percent-input>\r\n<v-dollar-percent-input percent value=\"50\" altLabel=\"test\"></v-dollar-percent-input>\r\n```\r\n\r\n#### Error\r\n\r\n```\r\n<v-dollar-percent-input error dollar value=\"200\" altLabel=\"test\"></v-dollar-percent-input>\r\n```\r\n\r\n#### Disabled\r\n\r\n```\r\n<v-dollar-percent-input disabled percent value=\"50\" altLabel=\"test\"></v-dollar-percent-input>\r\n```\r\n\r\n### Usage\r\n\r\n- Either the `dollar` or `percent` attribute should be passed. These attributes are responsible for applying the dollar- and percent-specific behaviors. See \"Properties\" below for more context. Character limits for digits preceding the decimal are hard-coded to 5 and 3 for `dollar` and `percent` respectively. The number of decimal places is flexible, and is passed via the `decimalplaces` attribute.\r\n- **Controlling the Value Programmatically**: When the `value` is passed programmatically, it must be passed as a `String`, not as an `Integer` or `Float`. The value **can** include decimals but **should not** include commas. It is expected that valid values will be passed - the checks ensuring that invalid edits to the input's `value` are not made **do not occur** when changes to `value` are made programmatically. (Examples of these checks include: the character limit restrictions, the removal of excess decimals, the removal/prevention of leading zeroes). In contrast, visual formatting updates **are** made even when changes to `value` are made programmatically - these include the addition of commas, and the resizing of the input's width. For more context on how this is happening, see the \"Data Flow\" bullet below under \"Context on Implementation\".\r\n\r\n```\r\nconst vDollarPercentInput = document.querySelector('v-dollar-percent-input')\r\n\r\n// This is correct:\r\nvDollarPercentInput.value = \"2000.00\"\r\n\r\n// These are incorrect:\r\nvDollarPercentInput.value = \"2,000.00\"\r\nvDollarPercentInput.value = 2000.00\r\n```\r\n\r\n- **Error State**: Be sure to use the `<v-error-text>` component with this component for any error messages.\r\n- **Context on Implementation**\r\n  - _Data Flow_: This component was designed to operate with a one-way data flow. In response either to user input or programmatic input, `this.value` is updated. (In the case of user input, standard input behavior is overridden, and edits to text input value are made programmatically.) Subsequently, `this.inputText` updates in reference to `this.value`. Commas and decimals are interpolated during this step. Finally, the input's width, and the user's cursor position are updated.\r\n  - _Cursor Positioning_: Although the majority of default input behavior is simply overridden, it was necessary nonetheless it use an `<input>` tag, because only input and textarea tags (and not contenteditable spans) have access to the `event.target.selectionEnd`, `event.target.selectionStart`, `el.setSelection` properties/methods, which are necessary for positioning the cursor after the text value has been updated. The use of an input in turn necessitated programmatic resizing, as inputs cannot resize with their content.\r\n\r\n### Properties\r\n\r\n| Attribute     | Property                      | Data Type | Default | Notes                                                                                                                                                                                                                                      |\r\n| ------------- | ----------------------------- | --------- | ------- | ------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------ |\r\n| decimalplaces | decimalPlaces                 | Number    | 0       | If greater than zero, decimal places will be shown.                                                                                                                                                                                        |\r\n| disabled      | disabled                      | Boolean   | false   | Applies disabled styles, and disables the internal input.                                                                                                                                                                                  |\r\n| dollar        | dollar                        | Boolean   | false   | Applies dollar input functionality. This includes prepending the dollar symbol, enforcing a 5-character limit for digits preceding the decimal, and adding commas as necessary for values > 999. Either `dollar` or `percent` is expected. |\r\n| error         | error                         | Boolean   | false   | Applies error styles. These styles will override other styles (for example, focus styles).                                                                                                                                                 |\r\n| -             | focus                         | Boolean   | false   | **Maintained internally**. Whether the input is currently being focused.                                                                                                                                                                   |\r\n| inputid       | inputId                       | String    | ''      | `id` of internal `<input type='text'>`                                                                                                                                                                                                     |\r\n| -             | inputText                     | String    | ''      | **Maintained Internally.** Value of the text input, with commas included.                                                                                                                                                                  |\r\n| -             | lastSelectionEnd              | Number    | 0       | **Maintained Internally.** Ignore. Necessary for determining the new position of the cursor after input.                                                                                                                                   |\r\n| -             | lastSelectionStart            | Number    | 0       | **Maintained Internally.** Ignore. Necessary for determining the new position of the cursor after input.                                                                                                                                   |\r\n| -             | numberOfExcessDecimalsRemoved | Number    | 0       | **Maintained Internally.** Ignore. Necessary for determining the new position of the cursor after input.                                                                                                                                   |\r\n| percent       | percent                       | Boolean   | false   | Applies percent input functionality. This includes prepending the percent symbol, and enforcing a 3-character limit for digits preceding the decimal. Either `dollar` or `percent` is expected.                                            |\r\n| value         | value                         | String    | \"\"      | Current value. Note that this value _must be passed as a String, and not an Integer or Float._                                                                                                                                             |\r\n| altLabel  | altLabel | String    | \"\"      | This optional field will present an alternative label for screen readers to read            | \r\n\r\n#### Transposed Attributes\r\n\r\nThe following attributes are transposed directly from the `<v-dollar-percent-input>` component to the internal `<input type='text'>`. This tranposition happens once, upon mounting.\r\n\r\n| Attribute |\r\n| --------- |\r\n| autofocus |\r\n| form      |\r\n| name      |\r\n| required  |\r\n\r\n### Events\r\n\r\nThis component emits both a standard `input` event and a custom `vdollarpercentinput-change` in response to changes to `value`. The custom event passes the current `value` via `event.detail.value`.\r\n\r\n#### Standard Events\r\n\r\n| Name    | Notes                             |\r\n| ------- | --------------------------------- |\r\n| `input` | Emits whenever the value changes. |\r\n\r\n#### Custom Events\r\n\r\n| Name                         | Notes                             | Detail Properties      |\r\n| ---------------------------- | --------------------------------- | ---------------------- |\r\n| `vdollarpercentinput-change` | Emits whenever the value changes. | `value`: the new value |\r\n");
