/* harmony default export */ var v_drilldown_menu_README = ("## v-drilldown-menu\r\n\r\n### Code\r\n\r\n```\r\n<v-drilldown-menu>\r\n  <v-drilldown-menu-page id=\"main\" level=\"0\">\r\n    <v-drilldown-menu-button to=\"retirement\" selected>\r\n      My Retirement Accounts\r\n    </v-drilldown-menu-button>\r\n    <v-drilldown-menu-button to=\"financial-wellness\">\r\n      Financial Wellness\r\n    </v-drilldown-menu-button>\r\n    <v-drilldown-menu-link href=\"/\">\r\n      Get Professional Advice\r\n    </v-drilldown-menu-link>\r\n    <v-drilldown-menu-link href=\"/\">My Profile</v-drilldown-menu-link>\r\n    <v-drilldown-menu-link href=\"/\">My Messages<v-icon circletext=\"25\" size=\"22px\" style=\"height: 18px; width: 18px;margin-left: 10px;\"></v-icon></v-drilldown-menu-link>\r\n\t<div slot=\"popularLinks\">\r\n            Popular Pages:\r\n            <span style=\"text-decoration:underline;color:#145A7B;\"\r\n              >Beneficiaries</span\r\n            ><span>&nbsp; ,&nbsp; </span\r\n            ><span style=\"text-decoration:underline;color:#145A7B;\"\r\n              >Getting Your Money</span\r\n            ><span>&nbsp; ,&nbsp; </span\r\n            ><span style=\"text-decoration:underline;color:#145A7B;\"\r\n              >Forgot PIN</span\r\n            ><span>&nbsp; ,&nbsp; </span\r\n            ><span style=\"text-decoration:underline;color:#145A7B;\"\r\n              >Get Investment Advice</span\r\n            >\r\n          </div>\r\n  </v-drilldown-menu-page>\r\n\r\n  <v-drilldown-menu-page\r\n    breadcrumbText=\"Main Menu\"\r\n    from=\"main\"\r\n    id=\"retirement\"\r\n    level=\"1\"\r\n    title=\"My Retirement Accounts\"\r\n  >\r\n    <v-drilldown-menu-link href=\"/\">My Overview</v-drilldown-menu-link>\r\n    <v-drilldown-menu-button to=\"retirement__401k\" selected>\r\n      My Employer 401k Account\r\n    </v-drilldown-menu-button>\r\n    <v-drilldown-menu-link href=\"/\">\r\n      My Roth IRA Account\r\n    </v-drilldown-menu-link>\r\n    <v-drilldown-menu-link href=\"/\">\r\n      My Rollover IRA Account\r\n    </v-drilldown-menu-link>\r\n  </v-drilldown-menu-page>\r\n\r\n  <v-drilldown-menu-page\r\n    breadcrumbText=\"My Retirement Accounts\"\r\n    from=\"retirement\"\r\n    id=\"retirement__401k\"\r\n    level=\"2\"\r\n    title=\"My Employer 401k Account\"\r\n  >\r\n    <v-drilldown-menu-button to=\"retirement__401k__overview\">\r\n      Overview\r\n    </v-drilldown-menu-button>\r\n    <v-drilldown-menu-link href=\"/\" selected>\r\n      Contributions & Savings\r\n    </v-drilldown-menu-link>\r\n    <v-drilldown-menu-link href=\"/\">Investments</v-drilldown-menu-link>\r\n    <v-drilldown-menu-link href=\"/\">\r\n      Loans & Withdrawals\r\n    </v-drilldown-menu-link>\r\n    <v-drilldown-menu-link href=\"/\">Plan Information</v-drilldown-menu-link>\r\n  </v-drilldown-menu-page>\r\n\r\n  <v-drilldown-menu-page\r\n    breadcrumbText=\"My Employer 401k Account\"\r\n    from=\"retirement__401k\"\r\n    id=\"retirement__401k__overview\"\r\n    level=\"3\"\r\n    title=\"Account Overview\"\r\n  >\r\n    <v-drilldown-menu-link href=\"/\">\r\n      Retirement Overview\r\n    </v-drilldown-menu-link>\r\n    <v-drilldown-menu-link href=\"/\">\r\n      Statement & Documents\r\n    </v-drilldown-menu-link>\r\n    <v-drilldown-menu-link href=\"/\">Account Activity</v-drilldown-menu-link>\r\n  </v-drilldown-menu-page>\r\n\r\n  <v-drilldown-menu-page\r\n    breadcrumbText=\"Main Menu\"\r\n    from=\"main\"\r\n    id=\"financial-wellness\"\r\n    level=\"1\"\r\n    title=\"Financial Wellness\"\r\n  >\r\n    <v-drilldown-menu-link href=\"/\">\r\n      My Resource Center\r\n    </v-drilldown-menu-link>\r\n    <v-drilldown-menu-link href=\"/\">\r\n      Financial Wellness Assessment\r\n    </v-drilldown-menu-link>\r\n    <v-drilldown-menu-link href=\"/\">\r\n      Life Stage Guidance\r\n    </v-drilldown-menu-link>\r\n    <v-drilldown-menu-link href=\"/\">\r\n      Calculators & Tools\r\n    </v-drilldown-menu-link>\r\n    <v-drilldown-menu-link href=\"/\">\r\n      Personal Finance Management\r\n    </v-drilldown-menu-link>\r\n  </v-drilldown-menu-page>\r\n</v-drilldown-menu>\r\n```\r\n\r\n### Usage\r\n\r\n- It's easiest to reason about this menu as a series of nested pages. However, the UX requirements made implementing a nested HTML structure difficult: when the user \"drills down\" into the next level, they see a whole new page sliding over the prior page. All of the menus are therefore sibling elements directly under `v-drilldown-menu`: each is a `v-drilldown-menu-page` with `v-drilldown-menu-link`s for its various links. Each of those pages is connected to its previous (parent) and next (child) pages by the `from` and `to` attributes, which must correspond to the `id`s of those respective pages.\r\n- **Determining the Drilldown Menu's Current Page**: The currently active page can be determined either via user input (clicking the link or breadcrumb buttons) or programmatically (by applying the `activate` attribute to the desired page).\r\n- **Depicting Which Page the User is Currently On (Outside the Drilldown Menu)**: The `selected` attribute on the `<v-drilldown-menu-link>` is provided for depicting which page the user is already on. It bolds the link text.\r\n- The search field `<v-search-field>` will be included automatically on the main page. Likewise the breadcrumb `<v-mobile-breadcrumb>` and heading will be included automatically on the subpages, which rely on the `breadcrumbtext` and `level`.\r\n- **Tab Navigation**: In order to facilitate tab-navigation, this component and its subcomponents adaptively change the tabindexes of any active elements to remove them from the document flow when they are not on the currently shown page. For some reason, the tabindexes are not assigned correctly in IE11 & Edge, so a minor workaround is used for those browser, hiding the relevant active elements unless on the current page (not done on the other browsers because it results in a flash of content on navigation).\r\n- **Styling**:\r\n  - **Height**: The menu has a fixed height by design - by default, that height is 574px, which is just enough to allow for 5 menu items on one of the sub pages (the breadcrumb & heading on the subpages being slightly taller together than the search field on the base page). If changed, the height should be determined by the maxmimum number of menu items expected.\r\n- **Design Notes**\r\n  - Although this is depicted on a card, it should not be used on a card in situ - it should take up the entirety of the screen. Please reference the mockups.\r\n  - It is recommended to use no more than 5 links in a menu page.\r\n  - It is expected that menus will be nested no more than 5 levels deep (4 plus the main or base-level page).\r\n  - If user want to use status icon with menu link text, they need to put it with menu link text like example.\r\n\r\n### Attributes\r\n\r\n| Attribute | Property         | Data Type | Default | Notes                                                                                                                                                                                                                            |\r\n| --------- | ---------------- | --------- | ------- | -------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------- |\r\n| n/a       | activatedPageIds | Array     | []      | **Maintained internally**. Array of ids of pages that are currently activated. This includes not only the current page, but also all of its \"ancestors\" - the submenus that you would pass through en route to the current page. |\r\n\r\n### Slots\r\n\r\n| Name         | Expects                   | Notes                                                                                                                                                                                                            |\r\n| ------------ | ------------------------- | ---------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------- |\r\n| none/default | `<v-drilldown-menu-page>` | All pages are siblings directly under `<v-drilldown-menu>`. The `<v-drilldown-menu-page>` must have `id`, `from`, `to`, `title`, and `breadcrumbText` attributes, as well as `<v-drilldown-menu-link>` children. |\r\n\r\n## v-drilldown-menu-page\r\n\r\n### Attributes\r\n\r\n| Attribute          | Property           | Data Type | Default | Notes                                                                                                                                                                                                                                                                     |\r\n| ------------------ | ------------------ | --------- | ------- | ------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------- |\r\n| activate           | activate           | Boolean   | false   | Apply to determine the current page. All ancestor pages will be \"activated\" along with the chosen page.                                                                                                                                                                   |\r\n| n/a                | activated          | Boolean   | false   | **Maintained internally**. Whether the page is activated. Even if activated, it will only be shown if it has a greater `level` value than the other activated pages.                                                                                                      |\r\n| breadcrumbtabindex | breadcrumbTabIndex | Number    | ''      | **Maintained internally**. Maps to the `buttontabindex` for the `<v-mobile-breadcrumb>`. Used to remove breadcrumbs from the tab-navigation flow as necessary.                                                                                                            |\r\n| breadcrumbtext     | breadcrumbText     | String    | ''      | Text for the breadcrumb. Must be passed if the page is not the \"main\" or base-level page. In most cases this will be the same as the heading text from the previous (parent) page.                                                                                        |\r\n| from               | from               | String    | ''      | Id of the previous (parent) page.                                                                                                                                                                                                                                         |\r\n| n/a                | isMain             | String    | false   | **Maintained internally**. Whether the page is the main or base-level page. Determined internally from the `level` value.                                                                                                                                                 |\r\n| level              | level              | Number    | 0       | How many levels deep the page is, zero-indexed. This _must_ be passed if the page is not the \"main\" or base-level page. This will determine the z-index of the page, and also be leveraged internally to determine whether or not a page has preceding pages (ancestors). |\r\n| shown              | shown              | Boolean   | false   | **Maintained internally**. Whether the page is the page with the greatest value for `level`, amonst the activated pages.                                                                                                                                                  |\r\n| title              | title              | String    | ''      | Text for the title. Must be passed if the page is not the \"main\" or base-level page. (ie. the `level` is greater than 0).                                                                                                                                                 |\r\n| isStaticSearch     | isStaticSearch     | Boolean   | false   | will come only at `level = 0`. if true, search page would be live search and search result will come without pressing enter or submit of page. If false, search would be static, search result will require enter press or submit of page                                 |\r\n| searchLink         | searchLink         | string    | null    | provide this link to submit search submit.                                                                                                                                                                                                                                |\r\n\r\n### Slots\r\n\r\n| Name         | Expects                   | Notes                                 |\r\n| ------------ | ------------------------- | ------------------------------------- |\r\n| none/default | `<v-drilldown-menu-link>` | At least two menu items are expected. |\r\n\r\n## v-drilldown-menu-button\r\n\r\nButton - if clicked, will drill down into the next level of the menu.\r\n\r\n### Attributes\r\n\r\n| Attribute | Property | Data Type | Default | Notes                                                                                                                                                                                                                                                                                                                                                                                                                 |\r\n| --------- | -------- | --------- | ------- | --------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------- |\r\n| active    | active   | Boolean   | false   | **Maintained internally**. Whether the component is currently being pressed/clicked. Applies active styles.                                                                                                                                                                                                                                                                                                           |\r\n| selected  | selected | Boolean   | false   | Applies selected styles (bolding). Whether the user is currently on either this page or one of its subpages. For example, if the user has opened the Drilldown Menu from the \"Mammals -> Cats -> Lions\" page, the \"Lions\" `<v-drilldown-menu-link>` should be `selected`, as well as all of the `<v-drilldown-menu-link>`s corresponding to its ancestors (\"Mammals\" and \"Cats\") on other `<v-drilldown-menu-page>`s. |\r\n| to        | to       | String    | ''      | Id of the subpage the item should link to. Either a `href` or a `to` should be passed.                                                                                                                                                                                                                                                                                                                                |\r\n| shown     | shown    | Boolean   | false   | **Maintained internally**. Whether the button is on the currently shown page. Used to dictate the tabindex.                                                                                                                                                                                                                                                                                                           |\r\n| tabindex  | tabIndex | Number    | 0       | **Maintained internally**. Tab index for the internal `<button>`. Managed to remove the button from the tab-navigation flow as necessary.                                                                                                                                                                                                                                                                             |\r\n\r\n### Slots\r\n\r\n| Name         | Expects   | Notes              |\r\n| ------------ | --------- | ------------------ |\r\n| none/default | text node | Text for the link. |\r\n\r\n## v-drilldown-menu-link\r\n\r\nLink - if clicked, will redirect to another page.\r\n\r\n### Attributes\r\n\r\n| Attribute | Property | Data Type | Default | Notes                                                                                                                                                                                                                                                                                                                                                                                                                 |\r\n| --------- | -------- | --------- | ------- | --------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------- |\r\n| active    | active   | Boolean   | false   | **Maintained internally**. Whether the component is currently being pressed/clicked. Applies active styles.                                                                                                                                                                                                                                                                                                           |\r\n| href      | href     | String    | ''      | Link href. If passed, the underlying component will be an `<a>` tag rather than a `<button>`. Either a `href` or a `to` is required.                                                                                                                                                                                                                                                                                  |\r\n| selected  | selected | Boolean   | false   | Applies selected styles (bolding). Whether the user is currently on either this page or one of its subpages. For example, if the user has opened the Drilldown Menu from the \"Mammals -> Cats -> Lions\" page, the \"Lions\" `<v-drilldown-menu-link>` should be `selected`, as well as all of the `<v-drilldown-menu-link>`s corresponding to its ancestors (\"Mammals\" and \"Cats\") on other `<v-drilldown-menu-page>`s. |\r\n| shown     | shown    | Boolean   | false   | **Maintained internally**. Whether the link is on the currently shown page. Used to dictate the tabindex.                                                                                                                                                                                                                                                                                                             |\r\n| tabindex  | tabIndex | Number    | 0       | **Maintained internally**. Tab index for the internal `<a>`. Managed to remove the link from the tab-navigation flow as necessary.                                                                                                                                                                                                                                                                                    |\r\n\r\n### Slots\r\n\r\n| Name         | Expects      | Notes                                                                          |\r\n| ------------ | ------------ | ------------------------------------------------------------------------------ |\r\n| none/default | text node    | Text for the link.                                                             |\r\n| popularLinks | popularLinks | will come only at `level = 0`. Used for providing poplar links for search page |\r\n\r\n### Events\r\n\r\n#### Custom Events\r\n\r\n| Name                      | Notes                            | Detail Properties                                                                                                                                 |\r\n| ------------------------- | -------------------------------- | ------------------------------------------------------------------------------------------------------------------------------------------------- |\r\n| `vdrilldownmenu-navigate` | Emits whenever the page changes. | `activatedPageIds`: an array of the ids of all currently activated pages - this includes the currently shown page as well as all of its ancestors |\r\n\r\n##### Used Internally\r\n\r\n| Name                            | Notes                                                                         | Detail Properties                          |\r\n| ------------------------------- | ----------------------------------------------------------------------------- | ------------------------------------------ |\r\n| `vdrilldownmenu-activatepage`   | Is emitted to communicate to the `v-drilldown-menu` which page to activate.   | `pageId`: id of the page to be activated   |\r\n| `vdrilldownmenu-deactivatepage` | Is emitted to communicate to the `v-drilldown-menu` which page to deactivate. | `pageId`: id of the page to be deactivated |\r\n");
