/* harmony default export */ var v_expandable_para_README = ("## v-expandable-para\r\n\r\n### Code\r\n\r\n```\r\n <h1>v-expandable-para</h1>\r\n  <v-expandable-para linkText=\"How is myOrangeMoney calculated?\">\r\n    <div class=\"v-callout-paragraph\" slot=\"expandableContent\">\r\n      <ol>\r\n        <li>\r\n          <p>\r\n            What is the purpose of myOrangeMoney?\r\n          </p>\r\n          <p style=\"margin-left: 20px;\">\r\n            myOrangeMoney is designed to give you a simple and actionable view\r\n            of your retirement income needs and your current progress towards\r\n            meeting those needs whether in 5 years or 40 years. Our goal is to\r\n            make sure you know where you stand regarding your readiness to\r\n            retire and to ensure that you know how to improve your outlook.\r\n          </p>\r\n        </li>\r\n        <li>\r\n          <p>How is my retirement income goal determined?</p>\r\n          <p style=\"margin-left: 20px;\">\r\n            To start, your retirement income goal is set to equal 70% of your\r\n            current annual pre-tax pay as provided by your employer or\r\n            input/edited by you. This is why we ask you to enter your salary the\r\n            first time you use myOrangeMoney. This number is an estimate of the\r\n            income you may need in retirement to maintain your standard of\r\n            living. This number represents an accepted standard in the financial\r\n            services industry and should only be viewed as a starting point for\r\n            your retirement planning. Every individual's needs are unique.\r\n          </p>\r\n        </li>\r\n        <li>\r\n          <p>Are retiree health care costs included in my goal?</p>\r\n          <p style=\"margin-left: 20px;\">\r\n            The default 70% replacement income assumes coverage of all retiree\r\n            expenses including retiree health care costs.\r\n          </p>\r\n        </li>\r\n        <li>\r\n          <p>Why do you need my date of birth?</p>\r\n          <p style=\"margin-left: 20px;\">\r\n            Your date of birth is needed to calculate your future retirement\r\n            income estimate, which is based on the estimated growth of your\r\n            assets between now and the time you intend to retire.\r\n          </p>\r\n        </li>\r\n      </ol>\r\n    </div>\r\n  </v-expandable-para>\r\n\r\n  <br />\r\n```\r\n\r\n### Usage\r\n\r\n- The component usage for this pattern would be for content that doesnt need as much prominence or attention on the page (or take as much space), but is available if you want to click it..\r\n- This component consists of two main areas - a link, which is always shown, and an expandable section that can be toggled open and shut by clicking the plus icon or link.\r\n\r\n### Attributes\r\n\r\n| Attribute | Property | Data Type | Default | Notes                                                                                      |\r\n| --------- | -------- | --------- | ------- | ------------------------------------------------------------------------------------------ |\r\n| linkText  | linkText | String    | false   | This is link which is going to be shown always and on clicked, will toggle expandable para |\r\n| open      | open     | Boolean   | false   | Determines whether the component is open or closed                                         |\r\n| tabindex  | tabIndex | Number    | 1       | Determines the tabindex value of the open/close button                                     |\r\n\r\n### Slots\r\n\r\n| Name                | Expects | Notes                                                  |\r\n| ------------------- | ------- | ------------------------------------------------------ |\r\n| \"expandableContent\" | n/a     | Content that will render in the hidden expandable area |\r\n\r\n### API\r\n\r\n| Function Name | Arguments | Notes                                       |\r\n| ------------- | --------- | ------------------------------------------- |\r\n| `toggle()`    | none      | Toggles the expandable area open and closed |\r\n");
