/* harmony default export */ var v_icon_README = ("# v-icon\r\n\r\n## Code\r\n\r\n### Primary & Secondary (Stateful)\r\n\r\n```\r\n<v-icon  primary></v-icon>\r\n<v-icon  secondary></v-icon>\r\n<v-icon primary disabled></v-icon>\r\n<v-icon primary error></v-icon>\r\n```\r\n\r\n### Options\r\n\r\n```\r\n<v-icon color=\"--v-states__success-color\" name=\"scorehealthgreen\"></v-icon>\r\n<v-icon\r\n  color=\"--v-states__success-color\"\r\n  name=\"scorehealthgreen\"\r\n  size=\"40px\"\r\n></v-icon>\r\n```\r\n\r\n### fontAwesome icons from fontAwesome library\r\n\r\n```\r\n <h2>font-awesome library icon naming notation</h2>\r\n  <div class=\"v-icon__row\">\r\n    <v-icon  primary name=\"fab fa-facebook-square\" size=\"24px\"></v-icon>\r\n    <span> branded fontawesome icons</span>\r\n  </div>\r\n  <div class=\"v-icon__row\">\r\n    <v-icon  secondary name=\"fas fa-globe-americas\" size=\"18px\"></v-icon>\r\n    <span> solid fontawesome icons</span>\r\n  </div>\r\n  <div class=\"v-icon__row\">\r\n    <v-icon  teritary name=\"far fa-envelope\" size=\"32px\"></v-icon>\r\n    <span> regular fontawesome icons</span>\r\n  </div>\r\n```\r\n\r\n### Available Icons By Name\r\n\r\n```\r\n<v-icon name=\"archiveselected\"></v-icon>\r\n<v-icon name=\"arrowaltdown\"></v-icon>\r\n<v-icon name=\"bell\"></v-icon>\r\n<v-icon name=\"calendaralt\"></v-icon>\r\n<v-icon name=\"caretdown\"></v-icon>\r\n<v-icon name=\"caretup\"></v-icon>\r\n<v-icon name=\"check\"></v-icon>\r\n<v-icon name=\"chevronright\"></v-icon>\r\n<v-icon name=\"cog\"></v-icon>\r\n<v-icon name=\"cogcircle\"></v-icon>\r\n<v-icon name=\"collapse\"></v-icon>\r\n<v-icon name=\"comment\"></v-icon>\r\n<v-icon name=\"commentdots\"></v-icon>\r\n<v-icon name=\"edit\"></v-icon>\r\n<v-icon name=\"envelope\"></v-icon>\r\n<v-icon name=\"exclamationtriangle\"></v-icon>\r\n<v-icon name=\"expand\"></v-icon>\r\n<v-icon name=\"eye\"></v-icon>\r\n<v-icon name=\"eyeslash\"></v-icon>\r\n<v-icon name=\"globeamericas\"></v-icon>\r\n<v-icon name=\"infocircle\"></v-icon>\r\n<v-icon name=\"lightbulb\"></v-icon>\r\n<v-icon name=\"listalt\"></v-icon>\r\n<v-icon name=\"mapmarker\"></v-icon>\r\n<v-icon name=\"mapmarkeralt\"></v-icon>\r\n<v-icon name=\"pdf\"></v-icon>\r\n<v-icon name=\"playcircle\"></v-icon>\r\n<v-icon name=\"print\"></v-icon>\r\n<v-icon name=\"profile\"></v-icon>\r\n<v-icon name=\"questioncircle\"></v-icon>\r\n<v-icon name=\"scorehealthgreen\"></v-icon>\r\n<v-icon name=\"scorehealthred\"></v-icon>\r\n<v-icon name=\"scorehealthyellow\"></v-icon>\r\n<v-icon name=\"search\"></v-icon>\r\n<v-icon name=\"share\"></v-icon>\r\n<v-icon name=\"shareCircle\"></v-icon>\r\n<v-icon name=\"sort\"></v-icon>\r\n<v-icon name=\"star\"></v-icon>\r\n<v-icon name=\"undo\"></v-icon>\r\n<v-icon name=\"universalaccess\"></v-icon>\r\n<v-icon name=\"x\">x</v-icon>\r\n<v-icon name=\"xsolid\"></v-icon>\r\n<v-icon name=\"magnifier\"></v-icon>\r\n<v-icon name=\"nucleo\"></v-icon>\r\n\r\n\r\n  <h1>v-icon-button-with-link-text</h1>\r\n  <div class=\"v-icon__row\">\r\n  <v-icon linkText name=\"lightbulb\">\r\n    Learn More About Pre-tax vs After-tax Savings\r\n  </v-icon>\r\n\r\n  <v-icon linkText  href=\"/unvisited\"\r\n    color=\"--v-colors__primary\"\r\n  >\r\n    Educational Link Text\r\n  </v-icon>\r\n\r\n\r\n  <div class=\"v-icon__row\">\r\n  <h1>v-icon-button-with-text  - Primary </h1>\r\n</div>\r\n  <div class=\"v-icon__row\">\r\n  <v-icon   linkButton primary href=\"/unvisited\" name=\"cogcircle\">\r\n    Settings - Anchor\r\n  </v-icon-button-with-text>\r\n</div>\r\n\r\n<div class=\"v-icon__row\">\r\n  <v-icon  linkButton primary name=\"cogcircle\">\r\n    Settings - Button\r\n  </v-icon-button-with-text>\r\n</div>\r\n\r\n<div class=\"v-icon__row\">\r\n<h1>v-icon-button-with-text  - Secondary </h1>\r\n</div>\r\n  <div class=\"v-icon__row\">\r\n  <v-icon  linkButton\r\n    secondary\r\n    href=\"/unvisited\"\r\n    name=\"universalaccess\"\r\n  >\r\n    Accessibility\r\n  </v-icon-button-with-text>\r\n  </div>\r\n\r\n  <h1>v-icon with keyboard tab enabled</h1>\r\n\r\n\r\n  <div class=\"v-icon__row\">\r\n    <v-icon primary iconTabIndex=0 @vicon-keyup=\"${e => callJSFunctionPrimary(e.detail.value)}\"></v-icon>\r\n    <span>Primary</span>\r\n  </div>\r\n\r\n  <div class=\"v-icon__row\">\r\n    <v-icon iconTabIndex=0 secondary @vicon-keyup=\"${e => callJSFunctionSecondary(e.detail.value)}\"></v-icon>\r\n    <span>Secondary</span>\r\n  </div>\r\n```\r\n\r\n## Usage\r\n\r\n- An icon can be `primary`, `secondary`, or other. These refer solely to the icon's color. Primary and secondary icons come with hover and active styles in addition to their base color. Disabled and error states can also be applied with the `disabled` and `error` attributes. If not `primary` or `secondary`, a color should be passed in via the `color` attribute.\r\n- Any icon which need to render from fontAwesome library need find or search exact name like this https://fontawesome.com/icons?d=gallery&q=file and pass name to v-icon then anything name includes \"fa-\" will render fontAwesome icon from fontAwesome library and if those icons are not available then need add SVG icons like how we had earlier in VDS(eg:Nucleo icons etc)\r\n- useCustomIcon need to set to `true` if any new SVG icon added in VDS. This will help to segerate customIcon svg vs fontAwesomeIcon from fa library.\r\n- Going forward, Any new custom icons (which are not available in fontAwesome library) will be passed from application team with svg imports and those slotted svg will be styles in vds inside the shadowDOM.\r\n- Sizing can be achieved in one of two ways: passing the `size` attribute, or passing both `height` and `width` attributes. `height` and `width` must _both_ be passed for either to take effect - otherwise both dimensions will take their value from `size`.\r\n- If `href` is passed, the underlying element will be an `<a>` tag. Otherwise, it will be a `<button>`.\r\n- **Design Guidelines**\r\n  - **Sizing**: The icons are displayed here in the default v-icon sizing of 25px. When used in context, sizing should be changed to reflect the design mockups.\r\n\r\n### To Add More Icons:\r\n\r\n1. Add the new icon svg to the `src/images/customIcons` or `src/images/fontAwesomeIcons` folder, following the established pattern.\r\n2. Doctor the SVG. To ensure that the resizing works, remove the `height` and `weight` attributes from the svg, but leave the `viewbox` attribute in place. To ensure that recoloring works, replace any `fill` attributes from the SVG's sub-elements with a class of fill: `class=\"fillable\"`. If it is an icon with a circle, also remove the `stroke` attribute from the `<circle>` and replace it with a class of `class=\"circle\"`. As a final note, it may be beneficial to set the focusable attribute to false. In IE11, `<svg>` tags are included in the tab-navigation flow by default, and in most cases this behavior will be undesirable. `focusable='false'` will eliminate that behavior. Example shown below.\r\n3. Update all files.\r\n\r\n- `src/images/index.js` Add the new export.\r\n- `src/components/v-icon/svg.js` Import the new icon and add it to the switch statement. If the name consists of more than one word, add a case both for downcase and for camelCase.\r\n- `src/components/v-icon/index.js` Add the new icon name in \"existingCustomizedIcons\" list.\r\n- `src/components/v-icon/demo.js` Add the new icon under \"Available Icons\".\r\n- `src/components/v-icon/README.md` Update the code to reflect changes to demo.js.\r\n\r\n**SVG Before**\r\n\r\n```\r\n  <svg\r\n    xmlns=\"http://www.w3.org/2000/svg\"\r\n    width=\"25\"\r\n    height=\"25\"\r\n    viewBox=\"0 0 25 25\"\r\n    focusable=\"false\"\r\n  >\r\n    <g fill=\"none\" fill-rule=\"evenodd\">\r\n      <circle\r\n        cx=\"12.5\"\r\n        cy=\"12.5\"\r\n        r=\"12\"\r\n        fill-rule=\"nonzero\"\r\n        stroke=\"#145A7B\"\r\n        stroke-opacity=\".5\"\r\n      />\r\n      <path\r\n        fill=\"#145A7B\"\r\n        fill-rule=\"nonzero\"\r\n        d=\"M18.963...\"\r\n      />\r\n    </g>\r\n  </svg>\r\n```\r\n\r\n**SVG After**\r\n\r\n```\r\n<svg xmlns=\"http://www.w3.org/2000/svg\" viewBox=\"0 0 25 25\">\r\n  <g fill=\"none\" fill-rule=\"evenodd\">\r\n    <circle class=\"circle\" cx=\"12.5\" cy=\"12.5\" r=\"12\" fill-rule=\"nonzero\" />\r\n    <path\r\n      class=\"fillable\"\r\n      fill-rule=\"nonzero\"\r\n      d=\"M18.963...\"\r\n    />\r\n  </g>\r\n</svg>\r\n```\r\n\r\n## Properties\r\n\r\n| Attribute           | Property            | Data Type | Default                 | Notes                                                                                                                                                                                  |\r\n| ------------------- | ------------------- | --------- | ----------------------- | -------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------- |\r\n| active              | active              | Boolean   | false                   | If passed, this will apply active styles. No internal logic governs this property - it's provided for cases in which the parent component must dictate when active styles are applied. |\r\n| color               | color               | String    | \"--v-colors\\_\\_primary\" | Must be one of the CSS variables in theme. Will only take effect if `primary` and `secondary` are not passed.                                                                          |\r\n| disabled            | disabled            | Boolean   | false                   | If passed, this will apply disabled styles. Only applies to either `primary` or `secondary` icons.                                                                                     |\r\n| error               | error               | Boolean   | false                   | If passed, this will apply error styles. Only applies to either `primary` or `secondary` icons.                                                                                        |\r\n| height              | height              | String    | \"\"                      | **Optional**. Must be a valid CSS width, eg. '20'px. Will only take effect if `width` is also passed. Otherwise, the component's height will be determined from `size`.                |\r\n| hover               | hover               | Boolean   | false                   | If passed, this will apply hover styles. No internal logic governs this property - it's provided for cases in which the parent component must dictate when hover styles are applied.   |\r\n| name                | name                | String    | \"exclamationtriangle\"   | Must be one of the options listed below.                                                                                                                                               |\r\n| primary             | primary             | Boolean   | false                   | Applies primary color scheme with hover and active states. Disabled and error states are applicable with `disabled` and `error` attributes.                                            |\r\n| secondary           | secondary           | Boolean   | false                   | Applies secondary color scheme, with hover and active states. Disabled and error states are applicable with `disabled` and `error` attributes.                                         |\r\n| darkOrange          | darkOrange          | Boolean   | false                   | Applies dark orange color scheme, with hover and active states. Disabled and error states are applicable with `disabled` and `error` attributes.                                       |\r\n| size                | size                | String    | \"25px\"                  | Must be a valid CSS width, eg. '20px'.                                                                                                                                                 |\r\n| width               | width               | String    | \"\"                      | **Optional**. Must be a valid CSS width, eg. '20'px. Will only take effect if `height` is also passed. Otherwise, the component's width will be determined from `size`.                |\r\n| href                | href                | String    | \"\"                      | **Optional**. If a non-empty string, the underlying element will be an `<a>`. Otherwise it will be a `<button>`.                                                                       |\r\n| tabIndex            | tabIndex            | Number    | 0                       | Maps to the `tabindex` for the internal `<a>` or `<button>` tag in case of `linkButton` true.                                                                                          |\r\n| target              | target              | String    | \"\\_self\"                | **Optional**. Maps to the `target` for anchor or button, where it tells new page/url opening target                                                                                    |\r\n| linkText            | linkText            | Boolean   | false                   | If passsed, this will turn v-icon to work as v-icon-button-with-link-text                                                                                                              |\r\n| linkButton          | linkButton          | Boolean   | false                   | If passsed, this will turn v-icon to work as v-icon-button-with-text                                                                                                                   |\r\n| applyhoverstyles    | applyHoverStyles    | Boolean   | false                   | If true, icon will use active and hover styles.                                                                                                                                        |\r\n| disableDefaultPrint | disableDefaultPrint | Boolean   | false                   | Only For `print` icon. If false, on click icon will do `window.print`, else icon will not do window.print and its open for override.                                                   |\r\n| circleText          | circleText          | String    | none                    | If passed, icon will be the provided text surrounded by a circle in the primary color                                                                                                  |\r\n| iconTabIndex        | iconTabIndex        | Number    | -1                      | Maps to the `tabindex` for the icon for simple icon case                                                                                                                               |\r\n\r\n### Custom CSS Properties\r\n\r\n| Custom CSS Property    | CSS property | default                          | Notes                                                |\r\n| ---------------------- | ------------ | -------------------------------- | ---------------------------------------------------- |\r\n| --v-icon-default-color | color        | --v-colors\\_\\_voya-dark-orange   | color will be applied to icon when not being hovered |\r\n| --v-icon-hover-color   | color        | --v-colors\\_\\_voya-darker-orange | color will be applied to icon when hovered           |\r\n\r\n### Events\r\n\r\nThe `<v-icon>` component emits a `vicon-keyup` Custom Event. this event is being emitted in case of simple icon( Without any href ).\r\n");
