/* harmony default export */ var v_input_field_README = ("# v-input-field\r\n\r\n### Code\r\n\r\n#### Left Column\r\n\r\n```\r\n<v-input-field\r\n  labeltext=\"Regular\"\r\n  name=\"Regular\"\r\n  placeholder=\"Placeholder\"\r\n></v-input-field>\r\n\r\n<v-input-field\r\n  disabled\r\n  labeltext=\"Disabled\"\r\n  name=\"Disabled\"\r\n  value=\"Disabled\"\r\n></v-input-field>\r\n\r\n<v-input-field\r\n  labeltext=\"Password\"\r\n  name=\"Password\"\r\n  password\r\n  value=\"password123\"\r\n></v-input-field>\r\n\r\n<v-input-field\r\n  labeltext=\"Create Password\"\r\n  name=\"Password\"\r\n  password\r\n  createPassword\r\n  value=\"\"\r\n></v-input-field>\r\n\r\n<v-input-field\r\n  labeltext=\"Confirm Password\"\r\n  name=\"Password\"\r\n  confirm=false\r\n  value=\"\"\r\n></v-input-field>\r\n<v-input-field\r\n  labeltext=\"SSN\"\r\n  name=\"ssn\"\r\n  ssn\r\n  maxLength=\"11\"\r\n  value=\"\"\r\n></v-input-field>\r\n<v-input-field\r\n  labeltext=\"Email\"\r\n  name=\"Email\"\r\n  type=\"email\"\r\n  value=\"example@email.com\"\r\n></v-input-field>\r\n```\r\n\r\n#### Right Column\r\n\r\n```\r\n<v-input-field\r\n  labeltext=\"Required\"\r\n  name=\"Required\"\r\n  required\r\n  value=\"Entry\"\r\n></v-input-field>\r\n\r\n<v-input-field\r\n  error\r\n  labeltext=\"Error\"\r\n  name=\"Error\"\r\n  value=\"Invalid Entry\"\r\n></v-input-field>\r\n\r\n<v-input-field\r\n  required\r\n  error\r\n  labeltext=\"Required with Error\"\r\n  name=\"Required with Error\"\r\n  value=\"Invalid Entry\"\r\n></v-input-field>\r\n\r\n<v-input-field\r\n  required\r\n  error\r\n  errortext=\"This value is invalid.\"\r\n  labeltext=\"Required with Error & Error Text\"\r\n  name=\"Required with Error & Error Text\"\r\n  value=\"Invalid Entry\"\r\n></v-input-field>\r\n\r\n<div class=\"column\">\r\n    <form method='GET' id='test' name='test'>\r\n      <v-input-field\r\n        labeltext=\"Field 1\"\r\n        name=\"field1\"\r\n        type=\"text\"\r\n      ></v-input-field>\r\n      <input type='text' name='field2'/>\r\n      <input type='submit' value='submit'/>\r\n    </form>\r\n  </div>\r\n```\r\n\r\n### Usage\r\n\r\n- Although the component is named v-input-field, this input will also facilitate the usage of other input types, like `email`.\r\n- To make an input of type=\"password\", provide the `password` attribute instead of providing a `type` of `'password'`.\r\n- To make use of the `spellcheck`, or `pattern` attributes for `<input />` you will have to set them programmatically:\r\n- To make use of the password complexity check to the input, add `createpassword` attribute to the v-input-field.\r\n- To confirm password check add `confirm` attribute to the v-input-field, pass `confirm = false` for a missmatch and pass `confirm = true` for password match.\r\n```\r\nconst vTextInput = document.querySelector('v-input-field`)\r\nconst inputEl = vTextInput.shadowRoot.querySelector('input')\r\ninputEl.setAttribute('spellcheck', '\"\"')\r\n```\r\n\r\n### Properties\r\n\r\n#### ...with novel behavior\r\n\r\n| Attribute     | Property      | Data Type | Default | Notes                                                                                                                                       |\r\n| ------------- | ------------- | --------- | ------- | ------------------------------------------------------------------------------------------------------------------------------------------- |\r\n| error         | error         | Boolean   | false   | Applies error styling. Also applied automatically, when `<input>` validations fail (ie. an email in an email field does not match pattern). |\r\n| errortext     | errorText     | String    | \"\"      | Unless a non-empty string is provided, no error text will appear.                                                                           |\r\n| inputtabindex | inputTabIndex | String    | \"\"      | Maps to the `tabindex` attribute of `<input/>`.                                                                                             |\r\n| labeltext     | labelText     | String    | \"\"      | This creates the text inside the `<label />`.                                                                                               |\r\n| altLabel      | altLabel      | String    | \"\"      | This optional field will present an alternative label for screen readers to read                                                            |\r\n| password      | password      | Boolean   | false   | If true, the input will be a password input, with the hide/show functionality.                                                              |\r\n| createpassword | createPassword | Boolean   | false   | If true, checks the password contains uppercase, lowercase, numeric, special character and minimum 8 characters.                                                              |\r\n| confirm | confirm | Boolean   | false   | If true, password matches and false for mismatch |\r\n| ssn | ssn | Boolean   | false   | If true, mask the 9 digit SSN  |\r\n| valid         | valid         | Boolean   | true    | Applied automatically, when `<input>` validations pass.                                                                                     |  |\r\n\r\n#### ...that correspond to native `<input />` attributes but have introduced behavior.\r\n\r\n| Attribute | Property | Data Type | Default | Notes                                                                   |\r\n| --------- | -------- | --------- | ------- | ----------------------------------------------------------------------- |\r\n| id        | id       | String    | \"\"      | Maps to `id` attribute of `<input />` and `for` attribute of `<label>`. |\r\n| value     | value    | String    | \"\"      | Current `value` of `<input />`.                                         |\r\n\r\n#### ...that correspond to native `<input />` or `<input type=\"text\" />` attributes and map one-to-one to the input element attributes.\r\n\r\n| Attribute    | Property     | Data Type | Default | Notes                                                                               |\r\n| ------------ | ------------ | --------- | ------- | ----------------------------------------------------------------------------------- |\r\n| autocomplete | autoComplete | String    | \"\"      |                                                                                     |\r\n| autofocus    | autoFocus    | Boolean   | false   |                                                                                     |\r\n| disabled     | disabled     | Boolean   | false   |                                                                                     |\r\n| form         | form         | String    | \"\"      |                                                                                     |\r\n| maxlength    | maxLength    | Number    | \"\"      |                                                                                     |\r\n| minlength    | minLength    | Number    | \"\"      |                                                                                     |\r\n| name         | name         | String    | \"\"      |                                                                                     |\r\n| placeholder  | placeholder  | String    | \"\"      |                                                                                     |\r\n| readonly     | readOnly     | Boolean   | false   |                                                                                     |\r\n| required     | required     | Boolean   | false   |                                                                                     |\r\n| size         | size         | Number    | \"\"      |                                                                                     |\r\n| type         | type         | String    | \"text\"  | For a password input, do not pass the type. Instead, pass the `password` attribute. |\r\n\r\n### API\r\n\r\n| Function Name     | Arguments | Notes                            |\r\n| ----------------- | --------- | -------------------------------- |\r\n| `checkValidity()` | none      | Returns validity of input value. |\r\n\r\n### Events\r\n\r\nUnder the hood, this is an `<input>` element. It will emit all events standard to that element. You may want to make use of:\r\n\r\n- `input` - when any input has been made\r\n- `change` - when the input loses focus, and its value has changed\r\n- `invalid` - when a form containing this input is submitted, and the input value is invalid\r\n");
