/* harmony default export */ var v_percentage_input_README = ("# v-percentage-input\r\n\r\n### Code\r\n\r\n```\r\n<v-percentage-input\r\n  value=\"42\"\r\n  altLabel=\"Default input\"\r\n></v-percentage-input>\r\n\r\n<v-percentage-input\r\n  value=\"2001\"\r\n  error\r\n  style=\"--v-percentage-input__input-wrapper-width: 6ch;\"\r\n  altLabel=\"Error input\"\r\n></v-percentage-input>\r\n\r\n<v-percentage-input\r\n  disabled\r\n  altLabel=\"Disabled input\"\r\n></v-percentage-input>\r\n```\r\n\r\n### Usage\r\n\r\n- **Styling:** When multiple `<v-percentage-input>` components are used together, as in the Contributions page, the intention is for them aligned - ie. have the same width. Because the `<input>` element itself grows and shrinks with its `value`, its container is given a fixed width instead. Declare the `--v-percentage-input__input-wrapper-width` css variable locally to specify this width. This width should be based on the maximum expected character length of the input.\r\n- **Error State** Be sure to use the `<v-error-text>` component with this component for any error messages.\r\n\r\n### Properties\r\n\r\n| Attribute | Property | Data Type | Default | Notes                                                                                                                                                                                                    |\r\n| --------- | -------- | --------- | ------- | -------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------- |\r\n| error     | error    | Boolean   | false   | Applies error styling. This attribute is applied automatically when the value is deemed invalid by standard `<input type=\"number\" />` validations: when above max, or below min, or indivisible by step. |\r\n| size      | size     | Number    | 1       | Initial value for `<input type=\"number\">`'s `size`. Changes dynamically internally with `value`.                                                                                                         |\r\n| valid     | valid    | Boolean   | true    | Applied automatically, when `<input type=\"number\">` validations pass.                                                                                                                                    |\r\n| value     | value    | Number    | 50      | Current value. Unlike `<input type='number'>`'s `value`, will reflect current value.                                                                                                                     |\r\n| altLabel  | altLabel | String    | \"\"      | This optional field will present an alternative label for screen readers to read            | \r\n\r\n#### ...that correspond to native `<input />` or `<input type=\"number\" />` attributes and map one-to-one to the input element attributes.\r\n\r\n| Attribute | Property  | Data Type | Default | Notes          |\r\n| --------- | --------- | --------- | ------- | -------------- |\r\n| autofocus | autoFocus | Boolean   | false   |                |\r\n| disabled  | disabled  | Boolean   | false   |                |\r\n| form      | form      | String    | \"\"      |                |\r\n| max       | max       | Number    | 100     | Maximum value. |\r\n| min       | min       | Number    | 0       | Minimum value. |\r\n| name      | name      | String    | \"\"      |                |\r\n| required  | required  | Boolean   | false   |                |\r\n| step      | step      | Number    | 1       | Increment.     |\r\n\r\n### API\r\n\r\n| Function Name     | Arguments | Notes                            |\r\n| ----------------- | --------- | -------------------------------- |\r\n| `checkValidity()` | none      | Returns validity of input value. |\r\n\r\n## Events\r\n\r\nUnder the hood, this is just a `<input type=\"number\">` with addons, so it will emit all events standard to that element. You may want to make use of:\r\n\r\n- `input` - when any input has been made\r\n- `change` - when the input loses focus, and its value has changed\r\n- `invalid` - when a form containing this input is submitted, and the input value is invalid\r\n");
