/* harmony default export */ var v_secondary_navigation_README = ("# v-secondary-navigation\r\n\r\n## Code\r\n\r\n```\r\n<v-secondary-navigation>\r\n  <v-secondary-navigation-tab illustration=\"hand\" tabText=\"Overview\">\r\n    <v-secondary-navigation-link link=\"/\">Retirement Overview</v-secondary-navigation-link>\r\n    <v-secondary-navigation-link link=\"/\">Statements & Documents</v-secondary-navigation-link>\r\n    <v-secondary-navigation-link link=\"/\">Account Activity</v-secondary-navigation-link>\r\n  </v-secondary-navigation-tab>\r\n</v-secondary-navigation>\r\n```\r\n\r\n## Usage\r\n\r\n- The Voya Design System secondary navigation is composed of three components. The `v-secondary-navigation` container component slot expects a series of `v-secondary-navigation-tab`s. These tab components expect `v-secondary-navigation-link` links as content.\r\n- The secondary navigation is designed to be used on desktop sized screens, with the expectation that it will be hidden on mobile and tablet screens in favor of a full screen hamburger menu.\r\n\r\n## v-secondary-navigation\r\n\r\n### Attributes\r\n\r\n- No attributes. This is a container component that handles structure and internal logic.\r\n\r\n### Slots\r\n\r\n| Name         | Expects                     | Notes                      |\r\n| ------------ | --------------------------- | -------------------------- |\r\n| none/default | v-secondary-navigation-tabs | Slot accepts multiple tabs |\r\n\r\n## v-secondary-navigation-tab\r\n\r\n### Attributes\r\n\r\n| Attribute    | Property     | Data Type | Notes                                                                            |\r\n| ------------ | ------------ | --------- | -------------------------------------------------------------------------------- |\r\n| active       | active       | Boolean   | Determines which tab is active on page load. There should only be one active tab |\r\n| illustration | illustration | String    | Currently must be one of five values (list below)                                |\r\n| tabtext      | tabtext      | String    | Text that appears in the menu tab                                                |\r\n| id           | id           | String    | represent id attribute of element                                                |\r\n| link         | link         | String    | href value for the resulting link                                                |\r\n| target       | target       | String    | target value for the resulting link,default is \\_self                            |\r\n\r\n### Illustration\r\n\r\ndocmagnifier\r\ndollarbill\r\nbargraph\r\nhand\r\ndocuments\r\n\r\n### Slots\r\n\r\n| Name         | Expects                      | Notes                       |\r\n| ------------ | ---------------------------- | --------------------------- |\r\n| none/default | v-secondary-navigation-links | Slot accepts multiple links |\r\n\r\n## v-secondary-navigation-links\r\n\r\n### Attributes\r\n\r\n| Attribute | Property | Data Type | Notes                                                       |\r\n| --------- | -------- | --------- | ----------------------------------------------------------- |\r\n| active    | active   | Boolean   | Determines which link is highlighted as active on page load |\r\n| path      | path     | String    | href value for the resulting link                           |\r\n| id        | id       | String    | represent id attribute of element                           |\r\n| target    | target   | String    | target value for the resulting link,default is \\_self       |\r\n\r\n### Slots\r\n\r\n| Name         | Expects | Notes                    |\r\n| ------------ | ------- | ------------------------ |\r\n| none/default | text    | Will appear as link text |\r\n");
