/* harmony default export */ var v_share_README = ("# v-share\r\n\r\n### Code\r\n\r\n```\r\n  <h1>v-share</h1>\r\n\r\n <h2>Left Bottom</h2>\r\n    <div class=\"first\">\r\n    <v-share left bottom icon=\"questioncircle\"\r\n\tconfig='{\"icons\":\r\n      [\r\n      {\"icon\":\"facebook\"},\r\n      {\"icon\":\"linkedin\"},\r\n\t  {\"icon\":\"twitter\"},\r\n\t  {\"icon\":\"envelope\"}\r\n      ]}\r\n\t  '\r\n\r\n\t>\r\n    </v-share>\r\n  </div>\r\n\r\n\r\n  <h2>Right Bottom</h2>\r\n  <div class=\"second\">\r\n    <v-share right bottom urlToShare=\"www.google.com\"\r\n\tconfig='{\"icons\":\r\n      [\r\n      {\"icon\":\"facebook\"},\r\n      {\"icon\":\"linkedin\"},\r\n\t  {\"icon\":\"twitter\"},\r\n\t  {\"icon\":\"envelope\"}\r\n      ]}\r\n\t  '\r\n\t>\r\n    </v-share>\r\n  </div>\r\n\r\n  <h2>Button With Link Text Right Bottom</h2>\r\n    <v-share right bottom icon=\"infocircle\" linkText=\"View Source Details\"\r\n\tconfig='{\"icons\":\r\n      [\r\n      {\"icon\":\"facebook\"},\r\n      {\"icon\":\"linkedin\"},\r\n\t  {\"icon\":\"twitter\"}\r\n      ]}\r\n\t  '\r\n\t>\r\n    </v-share>\r\n\r\n    <h2>Button With Link Text Left Bottom</h2>\r\n    <v-share left bottom icon=\"infocircle\" linkText=\"View Source Details\"\r\n\tconfig='{\"icons\":\r\n      [\r\n      {\"icon\":\"facebook\"},\r\n      {\"icon\":\"linkedin\"},\r\n\t  {\"icon\":\"twitter\"}\r\n      ]}\r\n\t  '>\r\n    </v-share>\r\n\r\n  <h2>Button With Link Text Right Top</h2>\r\n    <div class=\"second\">\r\n    <v-share right top icon=\"infocircle\" linkText=\"View Source Details\"\r\n\tconfig='{\"icons\":\r\n      [\r\n      {\"icon\":\"facebook\"},\r\n      {\"icon\":\"linkedin\"},\r\n\t  {\"icon\":\"twitter\"}\r\n      ]}\r\n\t  '>\r\n    </div>\r\n\r\n\r\n    <h2>Button With Link Text Left Top</h2>\r\n    <div class=\"second\">\r\n    <v-share left top icon=\"infocircle\" linkText=\"View Source Details\"\r\n\tconfig='{\"icons\":\r\n      [\r\n      {\"icon\":\"facebook\"},\r\n      {\"icon\":\"linkedin\"},\r\n\t  {\"icon\":\"twitter\"}\r\n      ]}\r\n\t  '>\r\n    </div>\r\n```\r\n\r\n### Usage\r\n\r\n- Uses a `<v-speech-bubble>` as a child. The speech bubble will be positioned correctly based on whether it is a `left` or a `right` speech bubble.\r\n- The speech bubble will appear if the share is either hovered or if it has been clicked. Once clicked, the user can either click again or click outside to hide it.\r\n- Tooltip will hide if \"Escape\" key is pressed or Clicked Outside of bubble.\r\n- onclick of corresponding icon, a separate window will open with sharer.\r\n\r\n### Properties\r\n\r\n| Attribute      | Property       | Data Type | Default                        | Notes                                                                                                               |\r\n| -------------- | -------------- | --------- | ------------------------------ | ------------------------------------------------------------------------------------------------------------------- |\r\n| active         | active         | Boolean   | false                          | **Maintained internally.** Whether the tooltip has been clicked, and is active.                                     |\r\n| config         | config         | Object    | null                           | Mandatory: provide icon names for the v-share bubble.                                                               |\r\n| hover          | hover          | Boolean   | false                          | **Maintained internally.** Whether the tooltip is hovered.                                                          |\r\n| icon           | icon           | String    | questioncircle                 | user can provide icon default will be questioncircle                                                                |\r\n| linkText       | linkText       | String    | none                           | if provided, tooltip will be a link with provided text, otherwise no link will display                              |\r\n| iconColor      | iconColor      | String    | --v-colors\\_\\_voya-dark-orange | default color for link icon, must be from theme, if none provided the primary color will be used                    |\r\n| iconHoverColor | iconHoverColor | String    | --v-menu-link-hover-color      | default color for link icon if hover or active, must be from theme, if none provided the default color will be used |\r\n| urlToShare     | urlToShare     | String    | www.voya.com                   | Url of to be shared item.                                                                                           |\r\n| top            | top            | Boolean   | false                          | position of sharepopup                                                                                              |\r\n| left           | left           | Boolean   | false                          | position of sharepopup                                                                                              |\r\n| right          | right          | Boolean   | false                          | position of sharepopup                                                                                              |\r\n| bottom         | bottom         | Boolean   | false                          | position of sharepopup                                                                                              |\r\n\r\n### Events\r\n\r\nCustom Events can include a `detail` object that provides relevant data. Access this data under `e.detail`. Here, access the `open` property with `e.detail.open`.\r\n\r\n| Name            | Notes                                                  | Detail Properties                                    |\r\n| --------------- | ------------------------------------------------------ | ---------------------------------------------------- |\r\n| `vshare-change` | fires whenever the speech bubble appears or disappears | `open` - whether the speech bubble is open or closed |\r\n");
