/* harmony default export */ var v_slider_README = ("# v-slider\r\n\r\n## Code\r\n\r\n```\r\n<v-slider min=\"0\" max=\"10000\" step=\"100\" altLabel=\"slider1 alt\"></v-slider>\r\n\r\n<v-slider min=\"0\" max=\"1\" step=\".01\" value=\".5\" error altLabel=\"slider2 error\"></v-slider>\r\n<v-slider min=\"0\" max=\"1\" step=\".01\" value=\".33\" disabled altLabel=\"slider3 disabled\"></v-slider>\r\n```\r\n\r\n## Usage\r\n\r\n- Use like a normal `<input type=\"range\" />` element. The `min`, `max`, and `step` attributes equate to their equivalents in `<input type=\"range\" />`. You can change the current value of the input programatically by targeting the `value` property.\r\n  ```\r\n    var slider = document.querySelector('v-slider') // Find the v-slider\r\n    slider.value = 2000 // Target the value property.\r\n  ```\r\n- Apply an attribute of `error` to apply error styles.\r\n- Apply an attribute of `disabled` to apply disabled styles and disable the slider.\r\n- Note that the component will not behave as expected unless sensible values are provided for `min`, `max`, `value`, and `step`.\r\n- **Event Listeners**: This component has event listeners for both `change` and `input` because IE11's `<input type='range'>` behaves differently from other browsers - it will emit a `change` event whenever the input value changes, but not an `input` event. The other browsers will emit an `input` event whenever the input value changes, and a `change` event on focusout, if the value has changed since focusin.\r\n\r\n## Properties\r\n\r\n| Attribute        | Property         | Data Type | Default | Notes                                                                                       |\r\n| ---------------- | ---------------- | --------- | ------- | ------------------------------------------------------------------------------------------- |\r\n| id               | id               | String    | \"\"      | Id or Name of the slider that uniquely identifies                                           |\r\n| max              | max              | Number    | 100     | Maximum of range. Corresponds to `max` of `<input type=\"range\" />`.                         |\r\n| min              | min              | Number    | 0       | Minimum of range. Corresponds to `min` of `<input type=\"range\" />`.                         |\r\n| value            | value            | Number    | 50      | Current value. Will update to reflect the current value of the underlying `value` property. |\r\n| step             | step             | Number    | 1       | Increment of range. Corresponds to `step` of `<input type=\"range\" />`.                      |\r\n| error            | error            | Boolean   | false   | Error state. If true, error styles are applied.                                             |\r\n| disabled         | disabled         | Boolean   | false   | Disabled state. If true, disabled styles are applied and slider is disabled.                |\r\n| altLabel         | altLabel         | String    | \"\"      | This is a mandatory field and will present an alternative label for screen readers to read  |\r\n| ariaReaderPrefix | ariaReaderPrefix | String    | \"\"      | This attribute is used for adding words before label for screen readers to read             |\r\n| ariaReaderSuffix | ariaReaderSuffix | String    | \"\"      | This attribute is used for adding words after label for screen readers to read              |\r\n\r\n## Events\r\n\r\nAs with all web components, any events emitted from the `<input type=\"range\" />` element will be emitted by proxy from the `v-slider` component. For details, see the [GoogleDevelopers documentation on The Shadow DOM Event Model](https://developers.google.com/web/fundamentals/web-components/shadowdom#events). Events you may want to leverage include:\r\n\r\n- `input` - when the value changes in response to user input\r\n- `mouseup` - when a user clicks on the track and releases, or drags the \"thumb\" then releases\r\n\r\nIn addition, this component emits a custom `vslider-change` event. This may be more useful than the above `input` event, because it will change even when the `value` is changed programmatically. Custom Events can include a `detail` object that provides relevant data. Access this data under `event.detail`.\r\n\r\n| Name             | Notes                             | Detail Properties             |\r\n| ---------------- | --------------------------------- | ----------------------------- |\r\n| `vslider-change` | Emits whenever the value changes. | `value`: newly selected value |\r\n");
